#
# TABLE STRUCTURE FOR: access_rights
#

DROP TABLE IF EXISTS `access_rights`;

CREATE TABLE `access_rights` (
  `id_employees` bigint(20) unsigned NOT NULL,
  `service_elevator` tinyint(1) NOT NULL,
  `store` tinyint(1) NOT NULL,
  `engineering_room` tinyint(1) NOT NULL,
  `work_this_equipment` tinyint(1) NOT NULL,
  KEY `id_employees` (`id_employees`),
  CONSTRAINT `access_rights_ibfk_1` FOREIGN KEY (`id_employees`) REFERENCES `employees` (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;



#
# TABLE STRUCTURE FOR: departments
#

DROP TABLE IF EXISTS `departments`;

CREATE TABLE `departments` (
  `id` bigint(20) unsigned NOT NULL AUTO_INCREMENT,
  `name_department` varchar(50) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  PRIMARY KEY (`id`),
  UNIQUE KEY `name_department` (`name_department`)
) ENGINE=InnoDB AUTO_INCREMENT=7 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;



#
# TABLE STRUCTURE FOR: employees
#

DROP TABLE IF EXISTS `employees`;

CREATE TABLE `employees` (
  `id` bigint(20) unsigned NOT NULL AUTO_INCREMENT,
  `firstname` varchar(50) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `lastname` varchar(50) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `mail` varchar(120) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `password_hash` varchar(100) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `phone` bigint(20) unsigned DEFAULT NULL,
  `department_id` bigint(20) unsigned NOT NULL,
  `position_id` bigint(20) unsigned NOT NULL,
  PRIMARY KEY (`id`),
  UNIQUE KEY `mail` (`mail`),
  UNIQUE KEY `phone` (`phone`),
  KEY `employees_firstname_lastname_idx` (`firstname`,`lastname`),
  KEY `employees_fk` (`department_id`),
  KEY `employees_fk1` (`position_id`),
  CONSTRAINT `employees_fk` FOREIGN KEY (`department_id`) REFERENCES `departments` (`id`) ON UPDATE CASCADE,
  CONSTRAINT `employees_fk1` FOREIGN KEY (`position_id`) REFERENCES `positions` (`id`) ON UPDATE CASCADE
) ENGINE=InnoDB AUTO_INCREMENT=2001 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;



#
# TABLE STRUCTURE FOR: equipment
#

DROP TABLE IF EXISTS `equipment`;

CREATE TABLE `equipment` (
  `id` bigint(20) unsigned NOT NULL AUTO_INCREMENT,
  `department_id` bigint(20) unsigned NOT NULL,
  `description` text COLLATE utf8mb4_unicode_ci NOT NULL,
  PRIMARY KEY (`id`),
  KEY `department_id` (`department_id`),
  CONSTRAINT `equipment_ibfk_1` FOREIGN KEY (`department_id`) REFERENCES `departments` (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=101 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;



#
# TABLE STRUCTURE FOR: messages
#

DROP TABLE IF EXISTS `messages`;

CREATE TABLE `messages` (
  `id` bigint(20) unsigned NOT NULL AUTO_INCREMENT,
  `from_user_id` bigint(20) unsigned NOT NULL,
  `to_user_id` bigint(20) unsigned NOT NULL,
  `body` text COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `created_at` datetime DEFAULT current_timestamp(),
  PRIMARY KEY (`id`),
  KEY `from_user_id` (`from_user_id`),
  KEY `to_user_id` (`to_user_id`),
  CONSTRAINT `messages_ibfk_1` FOREIGN KEY (`from_user_id`) REFERENCES `employees` (`id`),
  CONSTRAINT `messages_ibfk_2` FOREIGN KEY (`to_user_id`) REFERENCES `employees` (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=5001 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;



#
# TABLE STRUCTURE FOR: positions
#

DROP TABLE IF EXISTS `positions`;

CREATE TABLE `positions` (
  `id` bigint(20) unsigned NOT NULL AUTO_INCREMENT,
  `name_of_position` varchar(50) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `department_id` bigint(20) unsigned NOT NULL,
  PRIMARY KEY (`id`),
  UNIQUE KEY `name_of_position` (`name_of_position`),
  KEY `department_id` (`department_id`),
  CONSTRAINT `positions_ibfk_1` FOREIGN KEY (`department_id`) REFERENCES `departments` (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=81 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;



#
# TABLE STRUCTURE FOR: reporting_of_work
#

DROP TABLE IF EXISTS `reporting_of_work`;

CREATE TABLE `reporting_of_work` (
  `id` bigint(20) unsigned NOT NULL AUTO_INCREMENT,
  `id_employees` bigint(20) unsigned NOT NULL,
  `report` text COLLATE utf8mb4_unicode_ci NOT NULL,
  `time` datetime DEFAULT current_timestamp(),
  PRIMARY KEY (`id`),
  KEY `id_employees` (`id_employees`),
  CONSTRAINT `reporting_of_work_ibfk_1` FOREIGN KEY (`id_employees`) REFERENCES `employees` (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=3001 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;



#
# TABLE STRUCTURE FOR: store
#

DROP TABLE IF EXISTS `store`;

CREATE TABLE `store` (
  `id` bigint(20) unsigned NOT NULL AUTO_INCREMENT,
  `name_of_component` varchar(100) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `component_code` bigint(20) unsigned NOT NULL,
  `count` int(10) unsigned NOT NULL,
  PRIMARY KEY (`id`),
  UNIQUE KEY `component_code` (`component_code`),
  UNIQUE KEY `name_of_component` (`name_of_component`),
  KEY `store_component_code_idx` (`component_code`),
  KEY `name_of_component_idx` (`name_of_component`)
) ENGINE=InnoDB AUTO_INCREMENT=3001 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;



#
# TABLE STRUCTURE FOR: store_log
#

DROP TABLE IF EXISTS `store_log`;

CREATE TABLE `store_log` (
  `id` bigint(20) unsigned NOT NULL AUTO_INCREMENT,
  `id_who_take` bigint(20) unsigned NOT NULL,
  `id_what_take` bigint(20) unsigned NOT NULL,
  PRIMARY KEY (`id`),
  KEY `id_what_take` (`id_what_take`),
  KEY `store_who_take_what_take_idx` (`id_who_take`,`id_what_take`),
  CONSTRAINT `store_log_ibfk_1` FOREIGN KEY (`id_who_take`) REFERENCES `employees` (`id`),
  CONSTRAINT `store_log_ibfk_2` FOREIGN KEY (`id_what_take`) REFERENCES `store` (`id`) ON UPDATE CASCADE
) ENGINE=InnoDB AUTO_INCREMENT=2001 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;



#
# TABLE STRUCTURE FOR: time_stamps
#

DROP TABLE IF EXISTS `time_stamps`;

CREATE TABLE `time_stamps` (
  `id` bigint(20) unsigned NOT NULL AUTO_INCREMENT,
  `id_employees` bigint(20) unsigned NOT NULL,
  `datetime` datetime DEFAULT NULL,
  `status` enum('arrival','leave','dinner','end dinner','business trip') COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `id_employees_idx` (`id_employees`),
  CONSTRAINT `time_stamps_ibfk_1` FOREIGN KEY (`id_employees`) REFERENCES `employees` (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=1001 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;



